// Define a custom formatter for Vector3.
template <>
struct fmt::formatter<FVector> {
  // Parse the format string
  constexpr auto parse(format_parse_context& ctx) {
    // No format specifiers are used for Vector3
    auto it = ctx.begin(), end = ctx.end();
    if (it != end && *it != '}')
      throw format_error("invalid format");
    return it;
  }

  // Format the object
  template <typename FormatContext>
  auto format(const FVector& v, FormatContext& ctx) {
    return format_to(ctx.out(), "{{{}, {}, {}}}", v.X, v.Y, v.Z);
  }
};

// Define a custom formatter for Vector3.
template <>
struct fmt::formatter<FPlane> {
  // Parse the format string
  constexpr auto parse(format_parse_context& ctx) {
    // No format specifiers are used for Vector3
    auto it = ctx.begin(), end = ctx.end();
    if (it != end && *it != '}')
      throw format_error("invalid format");
    return it;
  }

  // Format the object
  template <typename FormatContext>
  auto format(const FPlane& v, FormatContext& ctx) {
    return format_to(ctx.out(), "{{{}, {}, {}, {}}}", v.X, v.Y, v.Z, v.W);
  }
};

#undef PI
static const float PI = 3.1415926535897932f;

/**
Calculates the horizontal field of view for a given resolution.
Code from http://emsai.net/projects/widescreen/fovcalc/
*/
int Misc::getFov(int defaultFOV, int resX, int resY)
{
	float aspect = (float)resX/(float)resY;
	float fov = (float) (atan(tan(defaultFOV*PI/360.0)*(aspect/(4.0/3.0)))*360.0)/PI;
	return (int) (fov + 0.5f);	
}

bool Misc::IsNvRemixAttached(bool pReevaluate)
{
 const auto func = []() {
    HANDLE hProcess = GetCurrentProcess();
    HANDLE hSnap = CreateToolhelp32Snapshot(TH32CS_SNAPPROCESS, 0);
    if (hSnap == INVALID_HANDLE_VALUE) {
      return false;
    }

    PROCESSENTRY32 pe32;
    pe32.dwSize = sizeof(PROCESSENTRY32);

    if (Process32First(hSnap, &pe32)) {
      do {
        if (pe32.th32ParentProcessID == GetProcessId(hProcess)) {
          std::wstring processName(pe32.szExeFile);
          if (processName == L"NvRemixBridge.exe") {
            CloseHandle(hSnap);
            return true;
          }
        }
      } while (Process32Next(hSnap, &pe32));
    }

    CloseHandle(hSnap);
    return false;
  };

  static bool flag = func();
  if (pReevaluate)
    flag = func();
  return flag;
}

